import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { useSelector } from 'react-redux';
import { useAppDispatch } from '../store/hooks';
import { RootState } from '@/store';
import { fetchClients } from '../store/clientsSlice';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;   /* vertical center */
  align-items: center;       /* horizontal center */
  width: 100%;
  min-height: calc(100vh - 64px); /* full height minus header if needed */
  padding: 2rem;
  box-sizing: border-box;
  background: #f5f6fa;
`;

const Title = styled.h2`
  margin-bottom: 1.5rem;
  color: #333;
  text-align: center;
`;

const TableWrapper = styled.div`
  width: 100%;
  max-width: 1200px;
  overflow-x: auto; /* horizontal scroll for small devices */
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  background: #fff;
  border-radius: 8px;
  overflow: hidden;
  box-shadow: 0 2px 8px rgba(0,0,0,0.1);
`;

interface ExpandedInfoProps {
  hasDetails: boolean;
}

const ExpandedInfo = styled.div<ExpandedInfoProps>`
  width: 100%;
  color: ${({ hasDetails }) => (hasDetails ? 'red' : 'green')};
`;

const Th = styled.th`
  text-align: left;
  padding: 12px;
  background: #f4f6f8;
  border-bottom: 1px solid #ddd;
  font-weight: 600;
`;

const Td = styled.td`
  padding: 12px;
  border-bottom: 1px solid #eee;
  font-size: 14px;
`;

const ExpandedTd = styled.td`
  padding: 12px;
  background: #f9f9f9;
  border-bottom: 1px solid #ddd;
  font-size: 14px;
`;

const Clients: React.FC = () => {
  const dispatch = useAppDispatch();
  const { clients, loading, error } = useSelector((state: RootState) => state.clients);
  const [expandedRow, setExpandedRow] = useState<number | null>(null);

  const toggleRow = (index: number) => {
    setExpandedRow(prev => (prev === index ? null : index));
  };

  useEffect(() => {
    dispatch(fetchClients());
  }, [dispatch]);

  if (loading) return <Container><p>Loading clients...</p></Container>;
  if (error) return <Container><p style={{ color: 'red' }}>{error}</p></Container>;

  return (
    <Container>
      <Title>Clients</Title>
      <TableWrapper>
        <Table>
          <thead>
            <tr>
              <Th>ID</Th>
              <Th>Email</Th>
              <Th>First Name</Th>
              <Th>Last Name</Th>
              <Th>Role</Th>
            </tr>
          </thead>
          <tbody>
            {clients.map((client, index) => (
              <React.Fragment key={index}>
                <tr 
                  onClick={() => toggleRow(index)}
                  style={{ cursor: 'pointer' }}
                > 
                  <Td>{client.firstName}</Td>
                  <Td>{client.lastName}</Td> 
                  <Td>{client.email}</Td>
                  <Td>{client.phone}</Td>  
                  <Td>{client.isActive}</Td>  
                  <Td>{client.createdAt}</Td> 
                   <Td>{client.updatedAt}</Td> 
                   
                </tr>

                {expandedRow === index && (
                  <tr>
                    <ExpandedTd colSpan={5}>
                      <ExpandedInfo hasDetails={!!Object.keys(client.address) && Object.keys(client.address).length > 0}>
                        <strong>Additional Info: </strong>
                        {client.details && client.details.length > 0 ? client.details : 'No additional details'}
                      </ExpandedInfo>
                    </ExpandedTd>
                  </tr>
                )}
              </React.Fragment>
            ))}
          </tbody>
        </Table>
      </TableWrapper>
    </Container>
  );
};

export default Clients;
